import React, { useState } from "react";
import { useEffect } from "react";
import { CustomOverlayMap, Map, MapMarker } from "react-kakao-maps-sdk";
import { Link, Route, Routes, useNavigate } from "react-router-dom";
import Chan from "../chan";

const { kakao } = window;

const MapPage = (props) => {
  const [isOpen, setIsOpen] = useState(false);
  const navigate = useNavigate();
  const [state, setState] = useState({
    center: {
      lat: 33.450701,
      lng: 126.570667,
    },
    errMsg: null,
    isLoading: true,
  });

  useEffect(() => {
    if (navigator.geolocation) {
      // GeoLocation을 이용해서 접속 위치를 얻어옵니다
      navigator.geolocation.getCurrentPosition(
        (position) => {
          setState((prev) => ({
            ...prev,
            center: {
              lat: position.coords.latitude, // 위도
              lng: position.coords.longitude, // 경도
            },
            isLoading: false,
          }));
        },
        (err) => {
          setState((prev) => ({
            ...prev,
            errMsg: err.message,
            isLoading: false,
          }));
        }
      );
    } else {
      // HTML5의 GeoLocation을 사용할 수 없을때 마커 표시 위치와 인포윈도우 내용을 설정합니다
      setState((prev) => ({
        ...prev,
        errMsg: "geolocation을 사용할수 없어요..",
        isLoading: false,
      }));
    }
  }, []);
  return (
    <>
      <div className=" items-center justify-center flex relative bg-blue-500 ">
        <button className=" absolute left-3">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            className="h-8 w-8"
            fill="none"
            viewBox="0 0 24 24"
            stroke="currentColor"
            strokeWidth={2}
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              d="M15 19l-7-7 7-7"
            />
          </svg>
        </button>
        <div className=" text-white font-bold text-5xl">market</div>
      </div>
      <Map // 지도를 표시할 Container
        id={`map`}
        center={state.center}
        style={{
          // 지도의 크기
          width: "100%",
          height: "450px",
        }}
        level={2} // 지도의 확대 레벨
      >
        <MapMarker position={state.center} onClick={() => setIsOpen(true)} />
        {isOpen && (
          <CustomOverlayMap position={state.center}>
            <div className=" w-40 h-24 box-border text-xs bg-blue-200 font-medium rounded-lg shadow-md p-3">
              <div className=" space-y-2">
                <div className="flex justify-between">
                  <div>장터 이름</div>
                  <div
                    className=" "
                    onClick={() => setIsOpen(false)}
                    title="닫기"
                  >
                    X
                  </div>
                </div>
                <div className=" flex  items-center space-x-3">
                  {/*  판매자 프로필 */}
                  <img
                    src="data:image/jpeg;base64,"
                    alt=""
                    className=" w-10 h-10 rounded-full"
                  />
                  <div>판매 물품</div>
                  <button>
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      className="h-6 w-6"
                      fill="none"
                      viewBox="0 0 24 24"
                      stroke="currentColor"
                      strokeWidth={2}
                    >
                      <path
                        strokeLinecap="round"
                        strokeLinejoin="round"
                        d="M9 5l7 7-7 7"
                      />
                    </svg>
                  </button>
                </div>
              </div>
            </div>
          </CustomOverlayMap>
        )}
      </Map>

      <Routes>
        <Route path=":id" element={<Chan />} />
      </Routes>
    </>
  );
};

export default MapPage;
